script: |
  super -f text -I q11625.spq | sort > q11625.out

inputs:
  - name: q11625.spq
    data: |
      SELECT DISTINCT - col0 * - + col0 * - + 60 AS col0, col2 + ( - col1 ) + + CAST ( NULL AS INTEGER ) * + col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE ( - - 47 + - col0 + - ( + + col2 ) * - + col2 IS NULL );
  - name: tab2

outputs:
  - name: q11625.out
    data: |
